const fillCardWithData = (data) => {
    return {
        home: {
            img: data.images[0].url,
            imgUrl: data.external_urls.spotify,
            header: data.artists[0].name,
            headerUrl: data.artists[0].external_urls.spotify,
            footer: data.name,
        },

        artist: {
            img: data.images[0].url,
            imgUrl: data.external_urls.spotify,
            header: data.name,
            headerUrl: data.external_urls.spotify,
            footer: data.followers.total,
        },
    };
};

export default fillCardWithData;
